    section.mail-overmind {
      width: auto;
      height: auto;
      min-width: 50vw;
      position: absolute;
      left: 50%;
      top: 50%;
      padding: 20px;
      background: linear-gradient(to right, #484848ce 0%, #202020ce 100%);
      border-radius: 10px;
      box-shadow: 2px 2px 100px black;
      -webkit-transform: translate(-50%, -50%);
      -moz-transform: translate(-50%, -50%);
      -ms-transform: translate(-50%, -50%);
      -o-transform: translate(-50%, -50%);
      transform: translate(-50%, -50%);
      color: white;
      font-family: system-ui, -apple-system, BlinkMacSystemFont, 'Segoe UI',
        Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue',
        sans-serif;
    }

    .mail-overmind h1,
    .mail-overmind h2 {
      text-transform: capitalize;
    }

    .mail-overmind h1 {
      font-size: x-large;
    }

    .mail-overmind h2 {
      font-size: large;
      text-transform: lowercase;
      font-weight: normal;
    }

    .mail-overmind h2::first-letter {
      text-transform: uppercase;
    }

    .mail-overmind h2 span {
      color: yellow;
    }

    .mail-overmind h2 span {
      text-transform: capitalize;
    }

    .mail-overmind div {
      padding: 10px 20px;
      border-left: 4px solid #d0d0d0;
      font-size: normal;
    }

    .mail-overmind div p span {
      font-weight: 600;
    }
  </style>
  <body>
    <section class="mail-overmind">
      <h1>Olá, recebemos uma nova solicitação de cadastro!</h1>
      <h2>
        Mensagem enviada por
        <span>{{fname}} {{lname}}</span>
      </h2>
      <div>
        <p>
          <span>Nome:</span>
          {{fname}}
        </p>
        <p>
          <span>Sobrenome:</span>
          {{lname}}
        </p>
        <p>
          <span>Telefone:</span>
          {{phone}}
        </p>
        <p>
          <span>E-mail:</span>
          {{email}}
        </p>
        <p>
          <span>Senha:</span>
          {{passwd}}
        </p>
      </div>
      <p>Att.</p>
      <p>chcmatos</p>
    </section>
  </body>
</html>
